// src/components/Login.js
import React, { useState } from 'react';
import { baseURL } from '../../config/api';

const Login = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');


  const handleLogin = async () => {
    
    const body = {
      username: username,
      password: password
    };

    try {
      const response = await baseURL.get("login", body);
      console.log(response)
    } catch (error) {
      console.error({ error });
    }
  };

  return (
    // <div className="login-container">
    //   <input
    //     className="login-input"
    //     type="text"
    //     value={username}
    //     onChange={(e) => setUsername(e.target.value)}
    //     placeholder="Username"
    //   />
    //   <input
    //     className="login-input"
    //     type="password"
    //     value={password}
    //     onChange={(e) => setPassword(e.target.value)}
    //     placeholder="Password"
    //   />
    //   <button className="login-button" onClick={handleLogin}>
    //     Login
    //   </button>
    // </div>

    <div style={{ maxWidth: '400px', margin: '0 auto', padding: '20px', border: '1px solid #ccc', borderRadius: '5px', backgroundColor: '#f9f9f9', textAlign: 'center' }}>
            <h2 style={{ marginBottom: '20px', color: '#333' }}>Welcome Back!</h2>
            <form>
                <div style={{ marginBottom: '15px' }}>
                    <input
                        style={{ width: '100%', padding: '10px', fontSize: '16px', border: '1px solid #ccc', borderRadius: '5px', outline: 'none' }}
                        type="text"
                        value={username}
                        onChange={(e) => setUsername(e.target.value)}
                        placeholder="Username"
                    />
                </div>
                <div style={{ marginBottom: '15px' }}>
                    <input
                        style={{ width: '100%', padding: '10px', fontSize: '16px', border: '1px solid #ccc', borderRadius: '5px', outline: 'none' }}
                        type="password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        placeholder="Password"
                    />
                </div>
                <button
                    style={{ width: '100%', padding: '10px', fontSize: '16px', border: 'none', borderRadius: '5px', backgroundColor: '#007bff', color: '#fff', cursor: 'pointer' }}
                    onClick={handleLogin}
                >
                    Login
                </button>
            </form>
        </div>
  );
};

export default Login;
